2	2024-10-14	Ejercicio 2. Calcula la concentración de una disolución que se obtiene a partir de mezclar 1.0 L de HCl 0.010 mol·L⁻¹ con 250.0 mL de HCl 0.100 mol·L⁻¹. Considera volúmenes aditivos.	Utilizando la ecuación:\r\n\\[\r\nM = \\frac{n}{V}\r\n\\]\r\n\r\nPara 1 L de HCl a 0.010 mol·L⁻¹:\r\n\\[\r\nn = V \\times M = 1 \\, \\text{L} \\times 0.010 \\, \\frac{\\text{mol HCl}}{\\text{L}} = 0.010 \\, \\text{mol HCl}\r\n\\]\r\n\r\nPara 250 mL de HCl a 0.100 mol·L⁻¹:\r\n\\[\r\nn = V \\times M = 0.25 \\, \\text{L} \\times 0.100 \\, \\frac{\\text{mol}}{\\text{L}} = 0.025 \\, \\text{mol HCl}\r\n\\]\r\n\r\nSumando la cantidad de sustancia de HCl:\r\n\\[\r\n0.010 \\, \\text{mol HCl} + 0.025 \\, \\text{mol HCl} = 0.035 \\, \\text{mol HCl}\r\n\\]\r\n\r\nSumando los volúmenes:\r\n\\[\r\n1 \\, \\text{L disolución} + 0.250 \\, \\text{L disolución} = 1.25 \\, \\text{L}\r\n\\]\r\n\r\nPor lo tanto, la concentración es:\r\n\\[\r\nM = \\frac{n}{V}\r\n\\]\r\n\\[\r\nM = \\frac{0.035 \\, \\text{mol HCl}}{1.25 \\, \\text{L}} = 0.028 \\, \\frac{\\text{mol}}{\\text{L}} \\, \\text{HCl}\r\n\\]	0.0028 mol·L⁻¹	\N	\N
1	2024-10-08	Ejercicio 1. El carbono-13 (¹³C) es un isótopo estable natural del carbono y uno de los isótopos ambientales más importantes ya que forma parte en una proporción del 1.10 % de todo el carbono natural de la Tierra. Calcula la masa de ¹³C que contiene una tonelada de metano CH₄. Masa molar: C = 12.0 g·mol⁻¹, CH₄ = 16.0 g·mol⁻¹.	\\[\r\n1.0 \\, \\text{t CH}_4 \\times \\frac{10^6 \\, \\text{g CH}_4}{1.0 \\, \\text{t CH}_4} \\times \\frac{1 \\, \\text{mol CH}_4}{16.0 \\, \\text{g CH}_4} \\times \\frac{1 \\, \\text{mol C}}{1 \\, \\text{mol CH}_4} \\times \\frac{12.0 \\, \\text{g C}}{1 \\, \\text{mol C}} \\times \\frac{1.10 \\, \\text{g } ^{13}\\text{C}}{100 \\, \\text{g C}} = 8.25 \\times 10^3 \\, \\text{g } ^{13}\\text{C}\r\n\\]	8.25 × 10³ g ¹³C		
20	2024-09-02	Ejercicio 19. La temperatura de ebullición normal del disulfuro de carbono, CS₂, es 319 K. Sabiendo que el calor de vaporización de este compuesto es 26.8 kJ·mol⁻¹, calcula la presión de vapor a 298 K y 1 atm.	La ecuación de Clausius-Clapeyron relaciona la presión de vapor de un líquido con la temperatura:\r\n\r\n\\[\r\n\\ln \\left(\\frac{P_2}{P_1}\\right) = \\frac{\\Delta H_{vap}}{R} \\left(\\frac{1}{T_1} - \\frac{1}{T_2}\\right)\r\n\\]\r\n\r\n(1 atm = 101.3 kPa)\r\n\r\nLa temperatura de ebullición normal a la que un líquido hierve implica que la presión exterior a la que debe igualarse su presión de vapor es 1 atm, con lo que la ecuación anterior se simplifica, ya que \\(\\ln P_1 = \\ln(1) = 0\\):\r\n\r\n\\[\r\n\\ln P_2 = \\frac{\\Delta H_{vap}}{R} \\left(\\frac{1}{T_2} - \\frac{1}{T_1}\\right)\r\n\\]\r\n\r\nEl valor de presión de vapor es:\r\n\r\n\\[\r\n\\ln P_2 = \\frac{26.8 \\, \\text{kJ} \\cdot \\text{mol}^{-1}}{8.31 \\times 10^{-3} \\, \\text{kJ} \\cdot \\text{mol}^{-1} \\cdot \\text{K}^{-1}} \\left(\\frac{1}{319 \\, \\text{K}} - \\frac{1}{298 \\, \\text{K}}\\right) = -0.71\r\n\\]\r\n\r\n\\[\r\nP_2 = e^{-0.71} = 0.49 \\, \\text{atm}\r\n\\]	0.49 atm		
3	2024-10-15	Ejercicio 3. Un estudiante de Química observó en el laboratorio que 0.2790 g de limadura de hierro, Fe, metálico se disolvían en 500 mL de HCl 0.05 mol·L⁻¹. Calcula el pH de la disolución obtenida. Masa molar: Fe = 55.8 g·mol⁻¹.	Cálculo para determinar la cantidad de sustancia a partir de la masa de Fe:\r\n\r\n\\[\r\n0.2790 \\, \\text{g Fe} \\times \\frac{1 \\, \\text{mol Fe}}{55.8 \\, \\text{g Fe}} = 5 \\times 10^{-3} \\, \\text{mol Fe}\r\n\\]\r\n\r\nCálculo para determinar la cantidad de sustancia de HCl a partir de la concentración y del volumen:\r\n\r\n\\[\r\nM = \\frac{n}{V} \\quad \\therefore \\quad n = M \\cdot V = 0.05 \\, \\frac{\\text{mol}}{\\text{L}} \\cdot 0.5 \\, \\text{L} = 0.025 \\, \\text{mol HCl}\r\n\\]\r\n\r\nLa ecuación balanceada es:\r\n\r\n\\[\r\n\\text{Fe}_{\\text{(s)}} + 2\\text{HCl}_{\\text{(ac)}} \\rightarrow \\text{FeCl}_{2\\text{(ac)}} + \\text{H}_{2\\text{(g)}}\r\n\\]\r\n\r\nSe propone el siguiente cuadro de avance de reacción:\r\n\r\n\\[\r\n\\begin{array}{c c c c c c c c}\r\n\\text{mol} & \\text{Fe}_{\\text{(s)}} & + & 2\\text{HCl}_{\\text{(ac)}} & \\rightarrow & \\text{FeCl}_{2\\text{(ac)}} & + & \\text{H}_{2\\text{(g)}} \\\\\r\n\\hline\r\n\\text{Inicio} & 0.005 & & 0.025 & & & & \\\\\r\n\\text{Reacciona} & -x & & -2x & & & & \\\\\r\n\\text{Se forma} & & & & & x & & x \\\\\r\n\\text{Final} & 0 & & 0.015 & & 0.005 & & 0.005 \\\\\r\n\\end{array}\r\n\\]\r\n\r\nPara conocer el reactivo limitante se debe despejar el valor de x igualando a cero ambas ecuaciones:\r\n\r\nPara Fe: \\( 0.005 - x = 0 \\quad \\therefore \\quad x = 0.005 \\, \\text{mol Fe} \\)\r\n\r\nPara HCl: \\( 0.025 - 2x = 0 \\quad \\therefore \\quad x = 0.0125 \\, \\text{mol HCl} \\)\r\n\r\nPor lo tanto, el reactivo limitante es hierro, Fe, y el cuadro de avance de reacción se completa con:\r\n\r\n\\( x = 0.005 \\, \\text{mol} \\)\r\n\r\nPara calcular la cantidad de sustancia que queda sin reaccionar de HCl:\r\n\r\n\\[\r\n0.025 - 2x = 0.025 - 2(0.005) = 0.015 \\, \\text{mol HCl}\r\n\\]\r\n\r\nComo el HCl es un ácido fuerte, está totalmente disociado en sus iones de acuerdo con la siguiente ecuación:\r\n\r\n\\[\r\n\\text{HCl}_{\\text{(ac)}} \\rightarrow \\text{Cl}^-_{\\text{(ac)}} + \\text{H}^+_{\\text{(ac)}} \\quad \\therefore \\quad [\\text{H}^+] = \\frac{0.015 \\, \\text{mol}}{0.5 \\, \\text{L}} = 0.03 \\, \\frac{\\text{mol}}{\\text{L}}\r\n\\]\r\n\r\nEl pH de la disolución resultante es:\r\n\r\n\\[\r\n\\text{pH} = -\\log(0.03) = 1.5\r\n\\]	pH = 1.5		
