6	2024-10-17	Ejercicio 5. En los años 80 se utilizaba comúnmente el bromuro de plata para la revelación de fotos en papel fotográfico, ya que este es un compuesto muy sensible a la luz. Si el producto de solubilidad del AgBr es 5.0 × 10⁻¹³ a 25 °C. ¿Cuál es su solubilidad molar en agua a esa temperatura?	El equilibrio entre \\(\\text{AgBr}\\) y sus iones es:\r\n\r\n\\[\r\n\\text{AgBr}_{(s)} \\rightleftharpoons \\text{Ag}^+_{(ac)} + \\text{Br}^-_{(ac)}\r\n\\]\r\n\r\nLa expresión de la constante del producto de solubilidad es:\r\n\r\n\\[\r\nK_{ps} = [\\text{Ag}^+][\\text{Br}^-] = (s)(s) = s^2 = 5.0 \\times 10^{-13}\r\n\\]\r\n\r\nPor lo que la solubilidad molar es:\r\n\r\n\\[\r\ns = \\sqrt{5.0 \\times 10^{-13}} = 7.1 \\times 10^{-7} \\, \\text{mol/L}\r\n\\]	7.1 × 10⁻⁷ mol·L⁻¹		
7	2024-10-21	Ejercicio 6. Encuentra la suma de los coeficientes estequiométricos de la ecuación balanceada de la siguiente reacción redox que ocurre en medio ácido:  \r\nMnO₄⁻(ac) + C₂O₄²⁻(ac) → Mn²⁺(ac) + CO₂(g)	Las ecuaciones de las semirreacciones que se llevan a cabo son:\r\n\r\n\\[\r\n\\text{Reducción:} \\quad 2(\\text{MnO}_4^-_{(ac)} + 8\\text{H}^+_{(ac)} + 5\\text{e}^-) \\rightleftharpoons \\text{Mn}^{2+}_{(ac)} + 4\\text{H}_2\\text{O}_{(l)}\r\n\\]\r\n\r\n\\[\r\n\\text{Oxidación:} \\quad 5(\\text{C}_2\\text{O}_4^{2-}_{(ac)}) \\rightleftharpoons 2\\text{CO}_2_{(g)} + 2\\text{e}^-\r\n\\]\r\n\r\n\\[\r\n\\text{Global:} \\quad 2\\text{MnO}_4^-_{(ac)} + 5\\text{C}_2\\text{O}_4^{2-}_{(ac)} + 16\\text{H}^+_{(ac)} \\rightarrow 2\\text{Mn}^{2+}_{(ac)} + 10\\text{CO}_2_{(g)} + 8\\text{H}_2\\text{O}_{(l)}\r\n\\]\r\n\r\nSuma de los coeficientes estequiométricos es igual a 43.	43		
8	2024-10-22	Ejercicio 7. A los estudiantes del Laboratorio de Tecnología de Alimentos de la Facultad de Química de la UNAM les regalaron una bebida de 1 L que contiene 17.8 % en masa de extracto de mango y 0.28 % de acidez (referida a la masa de ácido cítrico por cada 100 g de bebida o materia prima). Los estudiantes deben preparar 1.0 L de bebida con las condiciones escritas en la etiqueta y parten de pulpa de mango con 0.25 % de acidez. Haciendo un balance de materia, calcula la masa de ácido cítrico necesaria para la elaboración de la bebida. Nota: La densidad de estas bebidas es de 1 g·mL⁻¹.	Cálculo para determinar la masa de pulpa de mango que hay en la bebida:  \r\n\\[\r\n\\frac{17.8 \\, \\text{g pulpa de mango}}{100 \\, \\text{g bebida}} = 0.178 \\, \\text{g pulpa de mango/g bebida}\r\n\\]\r\n\r\nCálculo para determinar la cantidad de pulpa de mango necesario para 1000 g de bebida = 1 L de bebida:  \r\n\\[\r\n0.178 \\times 1000 = 178 \\, \\text{g pulpa de mango}\r\n\\]\r\n\r\nPara el balance de ácido cítrico:  \r\n\\[\r\n\\frac{178 \\, \\text{g pulpa de mango} \\times 0.25 \\, \\text{g ác. cítrico}}{100 \\, \\text{g pulpa de mango}} + x \\, \\text{g ác. cítrico} = \\frac{1000 \\, \\text{g de bebida} \\times 0.28 \\, \\text{g ác. cítrico}}{100 \\, \\text{g bebida}}\r\n\\]\r\n\r\n\\[\r\n0.445 \\, \\text{g ác. cítrico (pulpa de mango)} + x \\, \\text{g ác. cítrico} = 2.800 \\, \\text{g ác. cítrico (bebida)}\r\n\\]\r\n\r\n\\[\r\nx \\, \\text{g ác. cítrico} = 2.800 \\, \\text{g ác. cítrico} - 0.445 \\, \\text{g ác. cítrico}\r\n\\]\r\n\r\n\\[\r\nx \\, \\text{g ác. cítrico} = 2.355 \\, \\text{g ác. cítrico}\r\n\\]\r\n\r\nPor lo tanto, se requieren 2.355 g de ácido cítrico para formular la bebida.	2.355 g ácido cítrico		
9	2024-10-23	Ejercicio 8. El potencial de reducción de un electrodo normal de hidrógeno cuando está introducido en una disolución amortiguadora es −0.413 V. Calcula el pH de esta disolución.	La ecuación correspondiente a la reacción del electrodo es:\r\n\r\n\\[\r\n2\\text{H}^+_{(ac)} + 2\\text{e}^- \\rightleftharpoons \\text{H}_2_{(g)}\r\n\\]\r\n\r\nSe sabe que las condiciones en las que se encuentra la reacción son 25 °C y 1 atm.\r\n\r\nPara calcular el potencial del electrodo es necesario aplicar la ecuación de Nernst:\r\n\r\n\\[\r\nE = E^\\circ - \\frac{0.0592}{n} \\log Q = E^\\circ - 0.0592 \\log \\left(\\frac{P_{\\text{H}_2}}{[\\text{H}^+]^2}\\right)\r\n\\]\r\n\r\nTeniendo en cuenta que \\( E^\\circ = 0 \\) y que \\( P_{\\text{H}_2} = 1 \\, \\text{atm} \\), la ecuación anterior queda como:\r\n\r\n\\[\r\nE = -0.0592 \\, \\text{pH}\r\n\\]\r\n\r\nSustituyendo, se obtiene que el pH de la disolución amortiguadora es:\r\n\r\n\\[\r\n\\text{pH} = \\frac{-0.413}{-0.0592} = 6.98 \\approx 7.0\r\n\\]	pH = 7.0		
