12	2024-10-01	Ejercicio 11. El hidrógeno molecular, H₂, se puede obtener por reacción de un metal con HCl. Para ello se tratan 327 g de Zn al 90.0 % de pureza con una disolución de HCl al 40.0 % de pureza y una densidad de 1.198 g·mL⁻¹. Para estar seguros de que se disuelva el Zn, el ácido (HCl) se utiliza en un 25 % en exceso sobre el teóricamente necesario. Calcula el volumen total de disolución de HCl que se utiliza para disolver todo el zinc. Masa molar: Zn = 65.4 g·mol⁻¹, HCl = 36.5 g·mol⁻¹	Primero se debe calcular la cantidad de sustancia de Zn en la muestra:\r\n\r\n\\[\r\n327 \\, \\text{g muestra} \\times \\frac{90.0 \\, \\text{g Zn}}{100 \\, \\text{g muestra}} \\times \\frac{1 \\, \\text{mol Zn}}{65.4 \\, \\text{g Zn}} = 4.5 \\, \\text{mol Zn}\r\n\\]\r\n\r\nLa ecuación balanceada es:\r\n\r\n\\[\r\n2\\text{HCl}_{\\text{(ac)}} + \\text{Zn}_{\\text{(s)}} \\rightarrow \\text{ZnCl}_{2\\text{(ac)}} + \\text{H}_{2\\text{(g)}}\r\n\\]\r\n\r\n\r\n\r\nSe propone el siguiente cuadro de avance de reacción:\r\n\r\n\\[\r\n\\begin{array}{c c c c c c c c}\r\n\\text{mol} & 2\\text{HCl}_{\\text{(ac)}} & + & \\text{Zn}_{\\text{(s)}} & \\rightarrow & \\text{ZnCl}_{2\\text{(ac)}} & + & \\text{H}_{2\\text{(g)}} \\\\\r\n\\hline\r\n\\text{Inicio} & 2(4.5) = 9 & & 4.5 & & & & \\\\\r\n\\text{Reacciona} & -2x & & -x & & & & \\\\\r\n\\text{Se forma} & & & & & x & & x \\\\\r\n\\text{Final} & 0 & & 0 & & 4.5 & & 4.5 \\\\\r\n\\end{array}\r\n\\]\r\n\r\nCon los datos obtenidos en el cuadro de avance de reacción, podemos observar que se requieren 9 mol de HCl:\r\n\r\n\\[\r\n9 \\, \\text{mol HCl} \\times \\frac{36.5 \\, \\text{g HCl}}{1 \\, \\text{mol HCl}} \\times \\frac{100 \\, \\text{g dis}}{40 \\, \\text{g HCl}} \\times \\frac{1 \\, \\text{mL dis}}{1.198 \\, \\text{g dis}} = 686 \\, \\text{mL dis HCl}\r\n\\]\r\n\r\nTeniendo en cuenta que se utiliza un exceso del 25% (exceso):\r\n\r\n\\[\r\n686 \\, \\text{mL dis teórica} \\times \\frac{25 \\, \\text{mL dis exceso}}{100 \\, \\text{mL dis teórica}} = 171 \\, \\text{mL dis exceso}\r\n\\]\r\n\r\nEl volumen total de HCl añadido es:\r\n\r\n\\[\r\n686 \\, \\text{mL dis} + 171 \\, \\text{mL dis} = 857 \\, \\text{mL disolución de HCl}\r\n\\]	857 mL disolución de HCl		
4	2024-10-16	Ejercicio 4. La descomposición térmica de NaHCO₃ sólido produce Na₂CO₃ sólido, CO₂ gaseoso y vapor de agua, H₂O. El bicarbonato de sodio se utiliza en la fabricación del pan, pues su descomposición permite que el dióxido de carbono “suba” la masa del pan al hornearlo. Calcula el calor de reacción en condiciones estándar (273.15 K y 1 atm).\r\n\r\nDatos termodinámicos:\r\n\r\n\\begin{table}[h]\r\n    \\centering\r\n    \\begin{tabular}{lcc}\r\n        \\hline\r\n        \\textbf{Compuesto} & \\(\\Delta H_f^\\circ \\, (\\text{kJ} \\cdot \\text{mol}^{-1})\\) & \\(S^\\circ \\, (\\text{J} \\cdot \\text{mol}^{-1} \\cdot \\text{K}^{-1})\\) \\\\\r\n        \\hline\r\n        Bicarbonato de sodio sólido & -947.7 & 102.1 \\\\\r\n        Carbonato de sodio sólido & -1131.0 & 136.0 \\\\\r\n        Dióxido de carbono gaseoso & -393.5 & 213.6 \\\\\r\n        Agua gaseosa & -241.8 & 188.7 \\\\\r\n        \\hline\r\n    \\end{tabular}\r\n    \\caption{Valores de \\(\\Delta H_f^\\circ\\) y \\(S^\\circ\\) para diferentes compuestos.}\r\n\\end{table}	La ecuación química balanceada correspondiente a la reacción propuesta es: \r\n\\[\r\n2\\text{NaHCO}_3\\text{(s)} \\rightarrow \\text{Na}_2\\text{CO}_3\\text{(s)} + \\text{CO}_2\\text{(g)} + \\text{H}_2\\text{O(g)}\r\n\\]\r\n\r\nLa variación de entalpía de la reacción se calcula a partir de las entalpías de formación de productos y reactivos: \r\n\\[\r\n\\Delta H^\\circ = \\Sigma \\Delta H_f^\\circ \\text{(productos)} - \\Sigma \\Delta H_f^\\circ \\text{(reactivos)}\r\n\\]\r\n\r\nPara la ecuación propuesta:\r\n\\[\r\n\\Delta H^\\circ = [\\Delta H_f^\\circ (\\text{H}_2\\text{O}) + \\Delta H_f^\\circ (\\text{CO}_2) + \\Delta H_f^\\circ (\\text{Na}_2\\text{CO}_3)] - 2 \\Delta H_f^\\circ (\\text{NaHCO}_3)\r\n\\]\r\n\r\n\\[\r\n\\Delta H^\\circ = 1 \\, \\text{mol H}_2\\text{O}(-241.8 \\, \\text{kJ/mol H}_2\\text{O}) + 1 \\, \\text{mol CO}_2(-393.5 \\, \\text{kJ/mol CO}_2) + 1 \\, \\text{mol Na}_2\\text{CO}_3(-1131.0 \\, \\text{kJ/mol Na}_2\\text{CO}_3) - 2 \\, \\text{mol NaHCO}_3(-947.7 \\, \\text{kJ/mol NaHCO}_3) = 129.1 \\, \\text{kJ} \\, \\text{por} \\, 2 \\, \\text{mol NaHCO}_3\r\n\\]\r\n\r\nLa espontaneidad de un proceso la determina el valor de la energía libre de Gibbs, que se calcula mediante la siguiente expresión:\r\n\r\n\\[\r\n\\Delta G^\\circ > 0 \\quad \\text{proceso no espontáneo}\r\n\\]\r\n\\[\r\n\\Delta G^\\circ < 0 \\quad \\text{proceso espontáneo}\r\n\\]\r\n\r\nLa variación de entropía de la reacción puede calcularse a partir de las entropías de formación de productos y reactivos: \r\n\\[\r\n\\Delta S^\\circ = \\Sigma S^\\circ\\text{(productos)} - \\Sigma S^\\circ\\text{(reactivos)}\r\n\\]\r\n\\[\r\n\\Delta S^\\circ = [S^\\circ(\\text{H}_2\\text{O}) + S^\\circ(\\text{CO}_2) + S^\\circ(\\text{Na}_2\\text{CO}_3)] - 2S^\\circ(\\text{NaHCO}_3)\r\n\\]\r\n\r\n\\[\r\nS^\\circ = 1 \\, \\text{mol H}_2\\text{O}(188.7 \\, \\text{J/mol H}_2\\text{O}\\cdot \\text{K}) + 1 \\, \\text{mol CO}_2(213.6 \\, \\text{J/mol CO}_2\\cdot \\text{K}) + 1 \\, \\text{mol Na}_2\\text{CO}_3(136.0 \\, \\text{J/mol Na}_2\\text{CO}_3\\cdot \\text{K}) - 2 \\, \\text{mol NaHCO}_3(102.1 \\, \\text{J/mol NaHCO}_3\\cdot \\text{K}) = 334.1 \\, \\text{J/K}\r\n\\]\r\n\r\n\\[\r\n334.1 \\, \\text{J/K} \\times \\frac{1 \\, \\text{kJ}}{1000 \\, \\text{J}} = 0.3341 \\, \\text{kJ/K por 2 mol NaHCO}_3\r\n\\]\r\n\r\nEl valor de la energía libre de Gibbs es:\r\n\\[\r\n\\Delta G^\\circ = \\Delta H^\\circ - T \\Delta S^\\circ = \\frac{129.1 \\, \\text{kJ}}{2 \\, \\text{mol}} - 273.15 \\, \\text{K} \\times \\frac{0.3341 \\, \\text{kJ}}{2 \\, \\text{mol}\\cdot \\text{K}} = 18.92 \\, \\text{kJ/mol}\r\n\\]	El calor de reacción es igual a 38.58 kJ·mol⁻¹		
