13	2024-10-02	Ejercicio 12. De una disolución 0.30 mol·L⁻¹ de (NH₄)₂SO₄ se toman 100 mL y se colocan en un matraz aforado de 500 mL y se le agrega agua hasta el aforo. ¿Cuál es la concentración de NH₄⁺ de la nueva disolución?	La ecuación balanceada correspondiente al proceso de disolución del \\((\\text{NH}_4)_2\\text{SO}_4\\) es:\r\n\r\n\\[\r\n(\\text{NH}_4)_2\\text{SO}_4_{(ac)} \\rightarrow 2\\text{NH}_4^+_{(ac)} + \\text{SO}_4^{2-}_{(ac)}\r\n\\]\r\n\r\nComo es una sal que se disocia totalmente en agua:\r\n\r\n\\[\r\n0.1 \\, \\text{L} \\times \\frac{0.30 \\, \\text{mol}}{1 \\, \\text{L}} = 0.03 \\, \\text{mol} \\, (\\text{NH}_4)_2\\text{SO}_4\r\n\\]\r\n\r\n\\[\r\n0.03 \\, \\text{mol} \\, (\\text{NH}_4)_2\\text{SO}_4 \\times \\frac{2 \\, \\text{mol} \\, \\text{NH}_4^+}{1 \\, \\text{mol} \\, (\\text{NH}_4)_2\\text{SO}_4} = 0.06 \\, \\text{mol} \\, \\text{NH}_4^+\r\n\\]\r\n\r\n\\[\r\n[\\text{NH}_4^+] = \\frac{0.06 \\, \\text{mol} \\, \\text{NH}_4^+}{0.5 \\, \\text{L}} = 0.12 \\, \\text{mol/L}\r\n\\]	0.12 mol·L⁻¹		
10	2024-10-24	Ejercicio 9. Existen dispositivos como las pilas de combustible que permiten convertir la energía del hidrógeno en energía eléctrica y así se evita usar combustibles que generan dióxido de carbono.  \r\nLa ecuación de la reacción global que se lleva a cabo en este tipo de pilas es:  \r\n2H₂(g) + O₂(g) → 2H₂O(g)  \r\nUna pila tiene un rendimiento del 50 %. Calcula la energía que produce la reacción completa de 200 L de H₂(g) y 400 L de aire, sabiendo que el trabajo máximo que se puede obtener en una reacción química es igual a ΔG° multiplicado por el rendimiento. Los volúmenes de los gases están medidos en condiciones estándar (273.15 K y 1 atm).  \r\nDato: Composición aproximada del aire: 78.0 % N₂, 21.0 % O₂ y 1.0 % Ar. Considera comportamiento de gas ideal. Recuerda que pV = nRT (R = 0.082 atm·L·mol⁻¹·K⁻¹) y que ∆G° (agua líquida) = −237.13 kJ·mol⁻¹.	Se determina el reactivo limitante. Se considerará el comportamiento ideal y la cantidad de sustancia (ver tabla de reacción más abajo):\r\n\r\n\\[\r\nn = \\frac{1 \\, \\text{atm} \\cdot 200 \\, \\text{L H}_2}{(0.082 \\, \\text{atm} \\cdot \\text{L} \\cdot \\text{mol}^{-1} \\cdot \\text{K}^{-1}) \\cdot (273.15 \\, \\text{K})} = 8.93 \\, \\text{mol H}_2 \r\n\\]\r\n\r\n\\[\r\nn = \\frac{1 \\, \\text{atm} \\cdot 400 \\, \\text{L aire} \\cdot \\frac{21.0 \\, \\text{L O}_2}{100 \\, \\text{L aire}}}{(0.082 \\, \\text{atm} \\cdot \\text{L} \\cdot \\text{mol}^{-1} \\cdot \\text{K}^{-1}) \\cdot (273.15 \\, \\text{K})} = 3.75 \\, \\text{mol O}_2\r\n\\]\r\n\r\n\\[\r\n\\text{mol} \\quad 2\\text{H}_2_{(g)} + \\text{O}_2_{(g)} \\rightarrow 2\\text{H}_2\\text{O}_{(g)}\r\n\\]\r\n\r\n\\[\r\n\\begin{array}{c c c c c c}\r\n\\text{Inicio} & 8.93 & & 3.75 & & \\\\\r\n\\text{Reacciona} & -2x & & -x & & \\\\\r\n\\text{Se forma} & & & & & \\\\\r\n\\text{Final} & 1.43 & & 0 & & \\\\\r\n\\end{array}\r\n\\]\r\n\r\nPara conocer el reactivo limitante se debe despejar el valor de \\( x \\) igualando a cero ambas ecuaciones:\r\n\r\nPara \\(\\text{H}_2\\):\r\n\r\n\\[\r\n8.93 - 2x = 0 \\quad \\therefore \\quad x = 4.46 \\, \\text{mol H}_2\r\n\\]\r\n\r\nPara \\(\\text{O}_2\\):\r\n\r\n\\[\r\n3.75 - x = 0 \\quad \\therefore \\quad x = 3.75 \\, \\text{mol O}_2\r\n\\]\r\n\r\nPor lo tanto, el reactivo limitante es \\(\\text{O}_2\\) y el cuadro de avance de reacción se completa con \\( x = 3.75 \\, \\text{mol} \\).\r\n\r\nPara calcular la cantidad de sustancia de \\(\\text{H}_2\\) que no reacciona al cabo de la reacción:\r\n\r\n\\[\r\n8.93 - 2x = 8.93 - 2(3.75) = 1.43 \\, \\text{mol H}_2\r\n\\]\r\n\r\nLa energía libre de Gibbs (\\(\\Delta G^\\circ\\)) permite calcular el trabajo útil obtenido en una reacción química. Sabiendo que el rendimiento es del 50%:\r\n\r\n\\[\r\n7.50 \\, \\text{mol H}_2\\text{O} \\cdot \\frac{-237.13 \\, \\text{kJ}}{1 \\, \\text{mol H}_2\\text{O}} \\cdot \\frac{50 \\, \\text{kJ (real)}}{100 \\, \\text{kJ (teórico)}} = -890 \\, \\text{kJ}\r\n\\]	−890 kJ		resoluciones/ejercicio_9_CB4Vsnx.png
