16	2024-10-07	Ejercicio 15. Para la fabricación de algunas celdas solares es necesario utilizar PbBr₂ durante el proceso. Calcula el producto de solubilidad de PbBr₂ a 25 °C si la solubilidad de esta sal en agua a 25 °C es de 0.022 mol·L⁻¹.	El equilibrio entre \\(\\text{PbBr}_2\\) sólido y sus iones es:\r\n\r\n\\[\r\n\\text{PbBr}_2_{(s)} \\rightleftharpoons \\text{Pb}^{2+}_{(ac)} + 2\\text{Br}^-_{(ac)}\r\n\\]\r\n\r\nLa expresión de la constante del producto de solubilidad es:\r\n\r\n\\[\r\nK_{ps} = [\\text{Pb}^{2+}][\\text{Br}^-]^2 = (s)(2s)^2 = 4s^3\r\n\\]\r\n\r\nEl valor de la constante es:\r\n\r\n\\[\r\nK_{ps} = 4(0.022)^3 = 4.3 \\times 10^{-5}\r\n\\]	Kₚₛ = 4.3 × 10⁻⁵		
17	2024-10-09	Ejercicio 16. El etanol ingerido en las bebidas alcohólicas pasa a la sangre desde el estómago e intestino. La sangre se oxigena en los pulmones liberando CO₂ y etanol, CH₃CH₂OH. La detección del alcohol consiste en la reacción de etanol con dicromato de potasio, K₂Cr₂O₇, en medio ácido, formando ácido acético, CH₃CO₂H, incoloro y generando iones Cr³⁺ de color verde.  \r\nEscribe la ecuación iónica balanceada en medio ácido para la reacción de detección de etanol:	Las ecuaciones de las semirreacciones que tienen lugar son:  \r\n**Reducción:**  \r\n2(Cr₂O₇²⁻(ac) + 14H⁺(ac) + 6e⁻ ⇋ 2Cr³⁺(ac) + 7H₂O(l))  \r\n\r\n**Oxidación:**  \r\n3(CH₃CH₂OH(ac) + H₂O(l) ⇋ CH₃CO₂H(ac) + 4H⁺(ac) + 4e⁻)  \r\n\r\n**La ecuación final se obtiene sumando ambas ecuaciones:**  \r\n2Cr₂O₇²⁻(ac) + 16H⁺(ac) + 3C₂H₆O(ac) → 4Cr³⁺(ac) + 3CH₃CO₂H(ac) + 11H₂O(l)	2Cr₂O₇²⁻(ac) + 16H⁺(ac) + 3CH₃CH₂OH(ac) → 4Cr³⁺(ac) + 3CH₃CO₂H(ac) + 11H₂O(l)		
18	2024-10-10	Ejercicio 17. Enunciado día 9 de enero: A los estudiantes del Laboratorio de Tecnología de Alimentos de la Facultad de Química de la UNAM les regalaron una bebida de 1 L que contiene 17.8 % en masa de extracto de mango y 0.28 % de acidez (referida a la masa de ácido cítrico por cada 100 g de bebida o materia prima). Los estudiantes deben preparar 1.0 L de bebida con las condiciones escritas en la etiqueta y parten de pulpa de mango con 0.25 % de acidez. Haciendo un balance de materia, calcula la masa de ácido cítrico necesaria para la elaboración de la bebida. Nota: La densidad de estas bebidas es de 1 g·mL⁻¹.  \r\nRespuesta corta: 2.355 g ácido cítrico\r\n\r\nEnunciado:  \r\nRetomando la pregunta del 9 de enero, calcula la masa de sacarosa y de agua que se necesita para la elaboración de la misma bebida. Toma en cuenta que para el balance de los sólidos solubles (en este caso ss; sacarosa) se obtuvieron 10.2 °Brix de la muestra con la que se quiere igualar y de la fruta (materia prima) se obtuvieron 20.5 °Brix.  \r\n°Bx = 1 g ss (sacarosa) · 100 g⁻¹ de bebida	\\section*{Balance de sólidos solubles}\r\n\r\n\\[\r\n178.0 \\, \\text{g pulpa de mango} \\times \\frac{20.5 \\, \\text{g ss}}{100 \\, \\text{g pulpa de mango}} + 2.4 \\, \\text{g ác. cítrico} \\times \\frac{100 \\, \\text{g ss}}{100 \\, \\text{g ác. cítrico}} + x \\, \\text{g sacarosa} = 1000 \\, \\text{g de bebida} \\times \\frac{10.2 \\, \\text{g ss}}{100 \\, \\text{g bebida}}\r\n\\]\r\n\r\n\\[\r\n36.5 \\, \\text{g ss (pulpa de mango)} + 2.4 \\, \\text{g ss (ácido cítrico)} + x \\, \\text{g sacarosa} = 10.2 \\, \\text{g ss (bebida)}\r\n\\]\r\n\r\n\\[\r\nx \\, \\text{g sacarosa} = 36.5 \\, \\text{g ss} + 2.4 \\, \\text{g ss} - 10.2 \\, \\text{g ss}\r\n\\]\r\n\r\n\\[\r\nx \\, \\text{g sacarosa} = 28.6 \\, \\text{g sacarosa}\r\n\\]\r\n\r\nPor lo tanto, se requieren 28.6 g de sacarosa para formular la bebida.\r\n\r\n\\section*{Cálculo para determinar la masa de agua}\r\n\r\n\\[\r\n1000 - (178 \\, \\text{g extracto de mango} + 28.6 \\, \\text{g sacarosa} + 2.4 \\, \\text{g ácido cítrico})\r\n\\]\r\n\r\n\\[\r\n1000 - 209 = 791.0 \\, \\text{g de agua}\r\n\\]\r\n\r\nPor lo tanto, se requieren 791.0 g de agua y 28.6 g de sacarosa para formular la bebida.	791.0 g de agua y 28.6 g de sacarosa		
19	2024-10-11	Ejercicio 18. ¿Cuál es el pH de una disolución de NH₄Br 0.30 mol·L⁻¹? Kb (NH₃/NH₄⁺) = 1.7 × 10⁻⁵	El bromuro de amonio, \\(\\text{NH}_4\\text{Br}\\), en disolución acuosa se encuentra disociado según la ecuación:\r\n\r\n\\[\r\n\\text{NH}_4\\text{Br}_{(ac)} \\rightarrow \\text{NH}_4^+_{(ac)} + \\text{Br}^-_{(ac)}\r\n\\]\r\n\r\nEl ion \\(\\text{Br}^-\\) no tiene carácter básico y no se protona. El ion \\(\\text{NH}_4^+\\) es el ácido conjugado de la base débil \\(\\text{NH}_3\\) y se disocia según la ecuación:\r\n\r\n\\[\r\n\\text{NH}_4^+_{(ac)} + \\text{H}_2\\text{O}_{(l)} \\rightleftharpoons \\text{NH}_3_{(ac)} + \\text{H}_3\\text{O}^+_{(ac)}\r\n\\]\r\n\r\nLa constante de basicidad del amoniaco es \\(1.75 \\times 10^{-5}\\), por lo que la constante de disociación ácida del amonio es:\r\n\r\n\\[\r\nK_a = \\frac{K_w}{K_b} = 5.9 \\times 10^{-10}\r\n\\]\r\n\r\nCon esta información se puede plantear el equilibrio del amonio en disolución acuosa:\r\n\r\n\\[\r\nK_a = \\frac{[\\text{H}_3\\text{O}^+][\\text{NH}_3]}{[\\text{NH}_4^+]} = 5.9 \\times 10^{-10}\r\n\\]\r\n\r\nPlanteando el cuadro de avance de reacción:\r\n\r\n\\[\r\n\\begin{array}{c c c c}\r\n\\text{mol} \\cdot \\text{L}^{-1} & \\text{NH}_4^+_{(ac)} & + & \\text{H}_2\\text{O}_{(l)} \\rightleftharpoons \\text{NH}_3_{(ac)} + \\text{H}_3\\text{O}^+_{(ac)} \\\\\r\n\\hline\r\n\\text{Inicio} & 0.30 & & & & \\\\\r\n\\text{Reacciona} & -x & & & & \\\\\r\n\\text{Se forma} & & & x & x \\\\\r\n\\text{Al equilibrio} & 0.30 - x & & x & x \\\\\r\n\\end{array}\r\n\\]\r\n\r\nSe requiere resolver una ecuación de segundo grado para obtener la concentración de iones hidronio, \\(\\text{H}_3\\text{O}^+\\), al equilibrio y luego el pH:\r\n\r\n\\[\r\nK_a = \\frac{x^2}{0.30 - x} = 5.9 \\times 10^{-10}\r\n\\]\r\n\r\nLa ecuación que se genera es:\r\n\r\n\\[\r\nx^2 + (5.9 \\times 10^{-10})x - 1.77 \\times 10^{-10} = 0\r\n\\]\r\n\r\nLas raíces que se obtienen al resolver la ecuación son:\r\n\r\n\\[\r\nx_1 = 1.33 \\times 10^{-5} \\quad \\text{y} \\quad x_2 = -1.33 \\times 10^{-5}\r\n\\]\r\n\r\nSe utiliza la raíz cuyo valor tiene un sentido físico, es decir, \\(x_1 = 1.33 \\times 10^{-5}\\). De esta forma, la concentración de iones hidronio, \\(\\text{H}_3\\text{O}^+\\), al equilibrio es igual a \\(1.33 \\times 10^{-5}\\) y el pH es:\r\n\r\n\\[\r\n\\text{pH} = -\\log(1.33 \\times 10^{-5}) = 4.88	pH = 4.88		
